CREATE DATABASE IF NOT EXISTS PLANET_DB;

-- Create Planet Table
USE PLANET_DB;
CREATE TABLE IF NOT EXISTS Planets (
    planet_id INT PRIMARY KEY,
    planet_name VARCHAR(50),
    population_size INT,
    economic_development INT,
    galaxy_name VARCHAR(50),
    galaxy_id INT
);
ALTER TABLE Planets
ADD UNIQUE (planet_name);



-- CREATE Trade_Routes Table
USE PLANET_DB;
CREATE TABLE IF NOT EXISTS Trade_Routes (
    route_id INT PRIMARY KEY,
    origin_planet_id INT,
    destination_planet_id INT,
    distance_taken DECIMAL(7,2),
    FOREIGN KEY (origin_planet_id) REFERENCES Planets(planet_id),
    FOREIGN KEY (destination_planet_id) REFERENCES Planets(planet_id)
);


-- Create Trade_Agreements Table
USE PLANET_DB;
CREATE TABLE IF NOT EXISTS Trade_Agreements (
	agreement_id INT PRIMARY KEY,
	participating_planet1 INT,
	participating_planet2 INT,
    FOREIGN KEY (participating_planet1) REFERENCES Planets(planet_id),
	FOREIGN KEY (participating_planet2) REFERENCES Planets(planet_id)
);



-- Create Trade_Disputes Table
USE PLANET_DB;
CREATE TABLE IF NOT EXISTS Trade_Disputes (
    dispute_id INT PRIMARY KEY,
	dagreement_id INT,
	resolved VARCHAR(50),
	reason TEXT,
	FOREIGN KEY (dagreement_id) REFERENCES Trade_Agreements(agreement_id)
);


-- Create Raw_Materials Table
USE PLANET_DB;
CREATE TABLE IF NOT EXISTS Raw_Materials (
	raw_material_id INT PRIMARY KEY,
	raw_material_name VARCHAR(50),
	rplanet_id INT,
	cost_per_unit DECIMAL(4,2),
	amount_available INT,
    FOREIGN KEY (rplanet_id) REFERENCES Planets(planet_id)
);



-- Create Products Table
USE PLANET_DB;
CREATE TABLE IF NOT EXISTS Products (
    product_id INT PRIMARY KEY,
	product_name VARCHAR(40),
	price DECIMAL(6,2),
	quality_rating DECIMAL(3,2),
	pplanet_id INT,
	praw_material_id INT,
	ptech_id INT,
    FOREIGN KEY (pplanet_id) REFERENCES Planets(planet_id),
    FOREIGN KEY (praw_material_id) REFERENCES Raw_Materials(raw_material_id)
);


-- Create Cargo Table
USE PLANET_DB;
CREATE TABLE IF NOT EXISTS Cargo (
	cargo_id INT PRIMARY KEY,
	cproduct_id INT,
	craw_material_id INT,
	cagreement_id INT,
	cargo_class VARCHAR(50),
	quantity_product INT,
	quantity_raw_material INT,
	date_shipped DATE,
	estimated_arrival_date DATE,
	actual_arrival_date DATE,
    FOREIGN KEY (cproduct_id) REFERENCES Products(product_id),
    FOREIGN KEY (cagreement_id) REFERENCES Trade_Agreements(agreement_id),
    FOREIGN KEY (craw_material_id) REFERENCES Raw_Materials(raw_material_id)
);



-- Create Technology Table
USE PLANET_DB;
CREATE TABLE IF NOT EXISTS Technology (
	tech_id INT PRIMARY KEY,
	tplanet_id INT,
	tech_level INT,
	money_allocated DECIMAL(7,2),
	existing_future VARCHAR(8),
	economic_growth VARCHAR(6),
	tproduct_id INT,
    FOREIGN KEY (tplanet_id) REFERENCES Planets(planet_id),
    FOREIGN KEY (tproduct_id) REFERENCES Products(product_id)
);


-- Update FK References in Product Table
ALTER TABLE Products
ADD FOREIGN KEY (ptech_id) REFERENCES Technology(tech_id);